    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

    <script>/*
 *  Tile View for remark.js Slides
 *
 *  Garrick Aden-Buie
 *
 *  Inspired and converted to Vanilla JS from
 *  https://github.com/StephenHesperus/remark-hook/
 *
 *  Include after remarkjs slides are initialized.
 *
 */

/* global slideshow */
(function () {
  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const launchKey = 79 // keycode for O, used to enable tile view

    // Slides container
    const remarkSlideShow = document.querySelector('div.remark-slides-area')

    let tileView = document.querySelector('div.remark__tile-view')
    if (!tileView) {
      tileView = document.createElement('div')
      tileView.className = 'remark__tile-view'
    }

    const toggleElement = el => {
      el.style.display = el.style.display === 'none' ? '' : 'none'
    }

    const toggleTileView = function () {
      toggleElement(tileView)
      toggleElement(remarkSlideShow)

      if (tileView.style.display === 'none') {
        // tileView is now hidden, go to current slide
        slideshow.gotoSlide(tileVars.currentSlideIdx + 1)

        // remove scroll/mousewheel event blocking
        tileView.removeEventListener('mousewheel', blockEvent)
        tileView.removeEventListener('DOMMouseScroll', blockEvent)
        console.log('removing blockScaling')
        document.removeEventListener('keydown', blockScaling)
      } else {
        // store current slide index prior to launching tile-view
        tileVars.currentSlideIdx = slideshow.getCurrentSlideIndex()

        // set class on seen and current slide and scroll into view
        const tiles = tileView.querySelectorAll('.remark__tile-view__tile');
        [...tiles].forEach((tile, idx) => {
          tile.classList.toggle(
            'remark__tile-view__tile--seen',
            idx < tileVars.currentSlideIdx
          )
          tile.classList.toggle(
            'remark__tile-view__tile--current',
            idx === tileVars.currentSlideIdx
          )
        })
        tiles[tileVars.currentSlideIdx].scrollIntoView({
          behavior: 'smooth',
          block: 'center'
        })

        // block remarkjs from handling scroll events
        tileView.addEventListener('mousewheel', blockEvent)
        tileView.addEventListener('DOMMouseScroll', blockEvent)
        console.log('adding blockScaling')
        document.addEventListener('keydown', blockScaling)
      }
    }

    const createTileView = ({ minSize = 250, title = document.title } = {}) => {
      // Tile view header
      const h1 = document.createElement('h1')
      h1.className = 'remark__tile-view__header'
      h1.innerHTML = title

      tileView.appendChild(h1)
      const tiles = document.createElement('div')
      tiles.className = 'remark__tile-view__tiles'
      tileView.appendChild(tiles)

      // Clone slideshow
      const slidesArea = remarkSlideShow.cloneNode(true)

      // Calculate slide scale and tile container size
      const slideScaler = slidesArea.querySelector('.remark-slide-scaler')
      const slideWidth = parseFloat(slideScaler.style.width.replace('px', ''))
      const slideHeight = parseFloat(
        slideScaler.style.height.replace('px', '')
      )
      const scale = minSize / Math.min(slideWidth, slideHeight)
      let tileWidth = Math.round(slideWidth * scale)
      let tileHeight = Math.round(slideHeight * scale)

      // convert tileWidth/Height to em relative to base 18px (set in CSS)
      tileWidth = tileWidth / 18
      tileHeight = tileHeight / 18

      tiles.style.gridTemplateColumns = `repeat(auto-fill, minmax(${tileWidth}em, 1fr))`

      const slides = slidesArea.querySelectorAll('.remark-slide-container')

      slides.forEach((slide, slideIndex) => {
        let tile = document.createElement('template')
        tile.innerHTML = `<div class="remark__tile-view__tile">
            <div class="remark__tile-view__slide-container">
            </div></div>`
        tile = tile.content.firstChild

        const tileContainer = tile.querySelector(
          '.remark__tile-view__slide-container'
        )
        tileContainer.style.width = `${tileWidth}em`
        tileContainer.style.height = `${tileHeight}em`

        const thisSlideScaler = slide.querySelector('.remark-slide-scaler')
        thisSlideScaler.style.top = '0px'
        thisSlideScaler.style.left = '0px'
        thisSlideScaler.style.transform = `scale(${scale})`
        thisSlideScaler.parentElement.classList.add('remark-visible')

        slide.addEventListener('click', () => {
          tileVars.currentSlideIdx = slideIndex
          toggleTileView()
        })

        tileContainer.appendChild(slide)
        tiles.appendChild(tile)
      })

      document.body.appendChild(tileView)
    }

    const tileVars = {}
    const blockEvent = ev => ev.stopPropagation()
    const blockScaling = function (ev) {
      if (ev.controlKey || ev.metaKey) {
        if (ev.key === '=' || ev.key === '-') {
          ev.preventDefault()
          console.log('window scaling is not allowed inside the tile overview')
        }
      }
    }

    document.addEventListener('keydown', ev => {
      if (ev.keyCode === launchKey) {
        toggleTileView()
      }
    })

    const addTileViewHelpText = () => {
      const helpTable = document.querySelector(
        '.remark-help-content table.light-keys'
      )
      if (!helpTable) {
        console.error(
          'Could not find remark help table, has remark been initialized?'
        )
        return
      }
      const newRow = document.createElement('tr')
      newRow.innerHTML += '<td><span class="key">o</span></td>'
      newRow.innerHTML += '<td>Tile View: Overview of Slides</td>'
      helpTable.append(newRow)
    }

    createTileView({ minSize: 200 })
    toggleElement(tileView)
    addTileViewHelpText()
  })
})()
</script>

    <script>/* global slideshow,window,document */
window.xaringanExtraClipboard = function (selector, text) {
  if (!window.ClipboardJS.isSupported()) return
  if (!window.xaringanExtraClipboards) window.xaringanExtraClipboards = {}

  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const {
      button: buttonText = 'Copy Code',
      success: successText = 'Copied!',
      error: errorText = 'Press Ctrl+C to Copy'
    } = text

    const template = '<button class="xaringanextra-clipboard-button" ' +
       `type="button" aria-label="Copy code to clipboard">${buttonText}</button>`

    const isRemarkSlideshow = typeof slideshow !== 'undefined' &&
      Object.prototype.hasOwnProperty.call(slideshow, 'getSlides')

    let siblingSelector = selector || 'pre'
    if (!selector && isRemarkSlideshow) {
      siblingSelector = '.remark-slides-area ' + siblingSelector
    }

    // insert <button>s
    document.querySelectorAll(siblingSelector).forEach(el => {
      if ([/^$/, 'inherit', 'unset', 'revert', 'static'].some(p => el.style.position.match(p))) {
        el.style.position = 'relative'
      }
      el.insertAdjacentHTML('beforeend', template)

      // match button text color to code color
      const currentColor = window.getComputedStyle(el.children[0]).getPropertyValue('color')
      el.querySelector('button.xaringanextra-clipboard-button').style.color = currentColor
    })

    // initialize cliboardjs
    const clipboard = new window.ClipboardJS(siblingSelector + ' .xaringanextra-clipboard-button', {
      text: function (trigger) {
        // temporarily remove the button text
        // so that it isn't included in the text that's copied
        const btnLabel = trigger.innerHTML
        trigger.innerHTML = ''
        // snapshot text of copy button's parent element
        const text = trigger.parentElement.innerText
        // restore the button's inner HTML
        trigger.innerHTML = btnLabel
        return text
      }
    })

    // show success text for 2.5 seconds on success
    clipboard.on('success', function (ev) {
      ev.trigger.innerHTML = successText
      ev.trigger.style.display = 'block'
      setTimeout(function () {
        ev.trigger.innerHTML = buttonText
        ev.trigger.style.display = ''
      }, 2500)
      ev.clearSelection()
    })

    // show error text for 2.5 seconds on error
    clipboard.on('error', function (ev) {
      ev.trigger.innerHTML = errorText
      setTimeout(function () { ev.trigger.innerHTML = buttonText }, 2500)
    })

    // block remark click/touch slide change event listeners
    if (isRemarkSlideshow) {
      ['touchstart', 'touchend', 'touchmove'].forEach(function (evType) {
        document.querySelector('.remark-slides-area').addEventListener(evType, function (ev) {
          if (!ev.target.closest('pre')) return
          if (ev.target.closest('pre').querySelector('.xaringanextra-clipboard-button')) {
            ev.stopPropagation()
          }
        })
      })
    }

    window.xaringanExtraClipboards[siblingSelector] = clipboard
  })
}

## Why care about data types and formats?

There is a difference in how spatial information is stored, processed, and visually represented.
What does this mean for us?
 - Different commands to import and handle the data
 - Spatial linking techniques and analyses partially determined by the data format
 - Visualization of data can differ

So: Always know what kind of data you are dealing with!

---

## Representing the world in vectors

.pull-left[
.center[
&lt;img src=&quot;data:image/png;base64,#1_2_Vector_Data_files/figure-html/world-cities-1.png&quot; width=&quot;120%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]
]

.pull-right[
In a nutshell, the surface of the earth is represented by simple geometries and attributes assigned to each of these features.

What usually comes as vector data:
  - administrative borders 
  - rivers and roads, 
  - buildings, cities, and more

Georeferenced coordinates are the basis of vector data. 
Every object is defined by longitude (x) and latitude (y).
]

---

## Vector data: Geometries
.pull-left[
Each real-world features is represented as one of three types of geometries:
- Points: discrete location (f.e., city)
- Lines: linear feature   (f.e., river)
- Polygons: enclosed area  (f.e., country)

However, the geometries are not fixed. 
A city might be represented as a point on the world map, but if you zoom in, take a polygon shape.
]

.pull-right[
&lt;img src=&quot;data:image/png;base64,#./img/vector_geometries.png&quot; width=&quot;90%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
&lt;br&gt;
&lt;small&gt;&lt;small&gt;&lt;small&gt; National Ecological Observatory Network (NEON), cited by [Datacarpentry](https://datacarpentry.org/organization-geospatial/02-intro-vector-data/)&lt;/small&gt;&lt;/small&gt;&lt;/small&gt;
]

---

## Vector data: Attribute tables

The geometries of vector data hold firstly and foremost only up to three information:
  - location (points, lines, and polygons)
  - length (lines and polygons)
  - area (polygons)
    
We need to assign attributes to each geometry to hold additional information.
Thereby, attribute tables correspond to data tables.
Each row represents a geometric object, which we can also call observation or case.
Each column holds an attribute or, in &quot;our&quot; language, a variable.

---

## Vector data: Attribute tables

.center[
&lt;img src=&quot;data:image/png;base64,#./img/attr_table.png&quot; width=&quot;90%&quot; style=&quot;display: block; margin: auto;&quot; /&gt;
]

---

## New best friend: Shapefiles

Both the geometric information and attribute table can be saved within one file.
Most commonly, we use *ESRI Shapefiles* to store vector data.
They hold the information on the geometric type, location, and coordinate reference system and additionally store the attributes.
Even though we import only one file, shapefiles consist of at least three mandatory files with the extensions:
  - .shp : shape format
  - .shx : shape index format
  - .dbf : attribute format
  - (.prj: CRS/Projection)
  
You don&#39;t have to remember what they are standing for, but know that you won&#39;t be able to load the data if one of those files is missing.

---

## First summary 

1. Vector data come in three different geometric types: points, lines, polygons.

2. The geometric information is joined by an attribute table holding information for each geometric object.

3. Attribute tables can be treated as data tables.

4. Everything is stored in a Shapefile.

Let&#39;s give this some context and get to know vector data in R!

---

## Welcome to `simple features`

.pull-left[
.small[
Several packages are out there to wrangle and visualize spatial and, especially, vector data within `R`.
We are fans of a package called `sf` (&quot;simple features&quot;).

Why? 
`simple features` refers to a formal standard representing spatial geometries and supports interfaces to other programming languages and GIS systems.
As a bonus, it allows us to work in a `tibble` environment.
You might come across other packages, like `sp`, but we advise you to focus on `simple features` whenever possible. 
]
]

## Load a shapefile

The first step is, of course, loading the data.
We want to import the shapefile with the layer of the administrative borders of the German states (*Bundesländer*) called `GER_STATES`.



```r
# load library
library(sf)

# define at least the data source name (dsn)
# and the layer name 
german_states &lt;- st_read(dsn = &quot;./data&quot;,
                        layer = &quot;GER_STATES&quot;)
```

## Inspect your data: Classics

## `st_transform`

When a CRS is messed up, or one wants to combine data with not matching CRS, it will all go downwards.
The good thing is that the command `st_transform` allows us to  *translate* our spatial data from one coordinate reference system to another.


```r
# transform crs
german_states &lt;- st_transform(german_states, crs = 3035)

# check crs
st_crs(german_states) 
```

## From data table to geospatial data

We see that besides our attributes (e.g., year of data collection, number of beds...), the table contains the two variables &quot;X&quot; and &quot;Y&quot;, our point coordinates.
When using the command `st_as_sf`, make sure to use the option `crs = [EPSG_ID]`.
If not used, your CRS will not be defined, and you won&#39;t perform further commands depending on the CRS.
Good thing that Anne was the one who geocoded the addresses, and we know that the data are most likely stored in EPSG:3035.

```r

## Add attributes: Join data table

You might already spot that we have an id for the districts (*id* and *district_id*) in both data tables. 
This is a good example how easily `sf` objects can be handled.
With a regular left join of our additional attributes to the `sf` object, we can enhance our geospatial data and add more attributes.


```r
german_districts_enhanced &lt;- 
  german_districts %&gt;% 
  rename(., district_id = id) %&gt;% 
  left_join(. , attributes_districts, by = &quot;district_id&quot;)  

class(german_districts_enhanced)
```

## Add (More) Attributes: Spatial Join, Spatial Intersects, and More

Besides the regular join, we can also perform a so-called *spatial join*.

This is a small outlook for tomorrow on **Applied Data Wrangling**.
For example, we want to count the number of hospitals in each German district.
The hospital point layer was imported and is luckily already in the same CRS as the polygon layer of the German districts.
`st_join` does the trick.


```r
# perfom spatial join 
hospitals_in_districts &lt;- st_join(hospitals_sf, 
                                  german_districts_enhanced, 
                                  join = st_within)

# count the number of hospitals within a district
hospital_districts_count &lt;- count(as_tibble(hospitals_in_districts), 
                                  district_id) %&gt;%
                           rename(hospital_ct = n)  # optional

# Join the hospital count with the german district 
german_districts_enhanced&lt;- left_join(german_districts_enhanced, 
                                    hospital_districts_count, 
                                    by = &quot;district_id&quot;) %&gt;% 
                           mutate(hospital_ct = tidyr::replace_na(hospital_ct, 0)) # optional
```

## Subsetting the Data

One might be interested in only one specific area of Germany, like the capital Berlin.
To subset a `sf` object,  you often can use your usual data wrangling workflow. 
In this case, I know the district_id and that is also the only information I want to keep.

.pull-left[

```r
# subsetting
berlin &lt;-
german_districts_enhanced %&gt;% 
  filter(. , district_id == 11000) %&gt;% 
  select(., district_id) 

plot(berlin)

# or in Base R
german_districts_enhanced[which
        (german_districts_enhanced$
            district_id == 11000),
        &quot;district_id&quot;] %&gt;% 
        plot()
```
]

## Using `sf` for subsetting

If you have no information about *ids* but only about the geolocation, you can use `st_touches` to identify for example all districts which share a border with Berlin.
Spatial relations of object like `touches`, `within`, `intersect`, `crosses` are helpful tools to exploit the geometric information stored in the data when other information are missing.

.pull-left[

```r
# subsetting with st_touches
berlin_surrounding &lt;-
german_districts_enhanced %&gt;% 
  select(. , district_id) %&gt;% 
# length of mutual border &gt; 0
  filter(., lengths
         (st_touches(., berlin)) &gt; 0) 

plot(berlin_surrounding)
```
]

## Export the Data

After Wrangling and adjusting the data, you can save them.
There are, again, several options to do so.
Two notes:
.small[

1.Be careful when saving shapefiles: column names will automatically be abbreviated!
 
2.Make sure that the CRS is included either in your folder or the file name.

]



```r
# Export as Shapefile
st_write(german_districts_enhanced, 
         dsn = &quot;./own_material/districts_enhanced_epsg3035.shp&quot;, 
         layer = &quot;german_districts_enhanced_epsg3035.shp&quot;,  # optional
         driver = &quot;ESRI Shapefile&quot;,  # optional
         delete_layer = TRUE) #optional

# Export data frame as csv without geometric attributes
german_districts_enhanced_df &lt;- 
  st_set_geometry(german_districts_enhanced, NULL) 

write.csv(german_districts_enhanced , 
          &quot;./own_material/german_districts_enhanced.csv&quot;, 
          row.names = F, na= &quot;.&quot; )
  
# Export data frame as csv with geometric attributes
st_write(hospitals_sf, &quot;./own_material/hospitals_epsg3035.csv&quot;, 
         layer_options = &quot;GEOMETRY=AS_XY&quot;)
```

  d.head.appendChild(s);

(function(d) {
  var el = d.getElementsByClassName("remark-slides-area");
  if (!el) return;
  var slide, slides = slideshow.getSlides(), els = el[0].children;
  for (var i = 1; i < slides.length; i++) {
    slide = slides[i];

      els[i - 1].className += ' has-continuation';
    }
  }
  var s = d.createElement("style");
  s.type = "text/css"; s.innerHTML = "@media print { .has-continuation { display: none; } }";
  d.head.appendChild(s);
})(document);
// delete the temporary CSS (for displaying all slides initially) when the user
// starts to view slides
(function() {
  var deleted = false;
  slideshow.on('beforeShowSlide', function(slide) {
    if (deleted) return;
    var sheets = document.styleSheets, node;
    for (var i = 0; i < sheets.length; i++) {
      node = sheets[i].ownerNode;
      if (node.dataset["target"] !== "print-only") continue;

    }

  });
})();
(function() {

  var scripts = document.querySelectorAll(

  if (!scripts.length) return;
  for (var i = 0; i < scripts.length; i++) {
    var s = document.createElement('script');
    var code = document.createTextNode(scripts[i].textContent);
    s.appendChild(code);
    var scriptAttrs = scripts[i].attributes;
    for (var j = 0; j < scriptAttrs.length; j++) {
      s.setAttribute(scriptAttrs[j].name, scriptAttrs[j].value);
    }
    scripts[i].parentElement.replaceChild(s, scripts[i]);
  }
})();
(function() {

})();
// adds .remark-code-has-line-highlighted class to <pre> parent elements
// of code chunks containing highlighted lines with class .remark-code-line-highlighted
(function(d) {
  const hlines = d.querySelectorAll('.remark-code-line-highlighted');
  const preParents = [];
  const findPreParent = function(line, p = 0) {
    if (p > 1) return null; // traverse up no further than grandparent
    const el = line.parentElement;
    return el.tagName === "PRE" ? el : findPreParent(el, ++p);
  };

  for (let line of hlines) {
    let pre = findPreParent(line);
    if (pre && !preParents.includes(pre)) preParents.push(pre);
  }
  preParents.forEach(p => p.classList.add("remark-code-has-line-highlighted"));
